import React, { Component } from "react";
import api from "../../services/api";

import "./styles.css";

export default class Main extends Component {

    componentDidMount() {
        this.teste();
    };

    teste = async () => {
        const response = await api.get("");

        console.log(response);
    };

    render() {
        return (
            <div className="main-page">
                Hello World
            </div>
        );
    }
};
